import React from 'react';

const Panel = () => {
  return (
    <group>
      {/* Base panel box */}
      <mesh position={[0, 0, 0]}>
        <boxGeometry args={[60, 30, 0.5]} />
        <meshStandardMaterial color="#333" />
      </mesh>
    </group>
  );
};

export default Panel;
